// SPDX-License-Identifier: MIT
pragma solidity ^0.8.17;

import {SMEambStorage} from "/contracts/storage/LibSMEambStorage.sol";
import {Ownable} from "/contracts/mixins/Ownable.sol";

/**
 * @title SMEamb
 * @custom:version 1.0.0
 * @dev Модуль NFT амбассадоров клуба SoulMate Ambassador Club
 * @notice Первая стадия минта GENESIS
**/
contract init is Ownable{
    
    function initSMEambStorage() external onlyOwner(){
        SMEambStorage.baseTokenURI("http://158.160.153.72:8080/ipfs/QmP2VvsL8X9YzKVzVoGycokjwc3Tqyk9Q57XEeTrMvjnFo/");
        SMEambStorage.defaultTokenURI("http://158.160.153.72:8080/ipfs/QmP2VvsL8X9YzKVzVoGycokjwc3Tqyk9Q57XEeTrMvjnFo/1.json");
        SMEambStorage.genesislistRoot(0x68242c121f5458628253418bda76b8bf74da2bbbe03085331010b8176855526a);
        SMEambStorage.fee(14500000000000000000);
    }
}

